import React from 'react';
import { Card } from '../../models/card';
import CardComponent from '../pure/card';

// const pruebaImagen = require('../../assets/Unknown.jpeg');

const CardListComponent = () => {
    const defaultCard = new Card('Relojes', '', 'Producto de prueba')
    return (
        <div>
            <div>
                <h1>
                    Tus productos:
                </h1>
                <div>
                    <img src='../../assets/Unknown.jpeg' />
                </div>
                <CardComponent card={defaultCard} />
            </div>

        </div>
    );
};


CardListComponent.propTypes = {

};


export default CardListComponent;
